import React, { useEffect, useState } from 'react';
import { useParams, Link } from 'react-router-dom';
import axios from 'axios';
import AdminLayout from '../../layouts/AdminLayout';

export default function StudentIdCard() {
    const { cif } = useParams();
    const [idCards, setIdCards] = useState([]);
    const [requirements, setRequirements] = useState([]);
    const [pictures, setPictures] = useState([]);

    useEffect(() => {
        const fetchAll = async () => {
            try {
                const [idcRes, reqRes, picRes] = await Promise.all([
                    axios.get('http://localhost:8087/uam-carnet-sys/idcard'),
                    axios.get('http://localhost:8087/uam-carnet-sys/requirement'),
                    axios.get('http://localhost:8087/uam-carnet-sys/picture'),
                ]);
                // filtrar sÃ³lo los de este CIF
                setIdCards(idcRes.data.filter(i => i.cif === cif));
                setRequirements(reqRes.data.filter(r => r.cif === cif));
                setPictures(picRes.data.filter(p => p.cif === cif));
            } catch (err) {
                console.error('Error al cargar datos de carnet:', err);
            }
        };
        fetchAll();
    }, [cif]);

    return (
        <AdminLayout>
            <div className="max-w-4xl mx-auto mt-10 p-6 bg-white rounded shadow">
                <h1 className="text-2xl font-bold mb-4">Solicitudes de Carnet de {cif}</h1>

                <Link to="/admin/students" className="text-blue-600 hover:underline mb-4 block">
                    â Volver a Estudiantes
                </Link>

                {/* ID Cards */}
                <section className="mb-6">
                    <h2 className="text-xl font-semibold mb-2">ID Cards</h2>
                    {idCards.length ? (
                        idCards.map(i => (
                            <div key={i.idCardId} className="border p-4 rounded mb-2">
                                <p><strong>ID:</strong> {i.idCardId}</p>
                                <p><strong>Estado:</strong> {i.status}</p>
                                <p><strong>Entrega:</strong> {i.deliveryAppointment}</p>
                                <p><strong>Notas:</strong> {i.notes}</p>
                            </div>
                        ))
                    ) : (
                        <p className="text-gray-500">No hay solicitudes de carnet.</p>
                    )}
                </section>

                {/* Requisitos de pago */}
                <section className="mb-6">
                    <h2 className="text-xl font-semibold mb-2">Requisitos de Pago</h2>
                    {requirements.length ? (
                        requirements.map(r => (
                            <div key={r.requirementId} className="border p-4 rounded mb-2">
                                <p><strong>ID Req:</strong> {r.requirementId}</p>
                                <p><strong>Comprobante:</strong> <a href={r.paymentProofUrl} target="_blank" rel="noreferrer" className="text-blue-600 hover:underline">Ver</a></p>
                            </div>
                        ))
                    ) : (
                        <p className="text-gray-500">Sin requisitos de pago.</p>
                    )}
                </section>

                {/* FotografÃ­as */}
                <section>
                    <h2 className="text-xl font-semibold mb-2">FotografÃ­as</h2>
                    {pictures.length ? (
                        pictures.map(p => (
                            <div key={p.pictureId} className="border p-4 rounded mb-2">
                                <p><strong>ID Foto:</strong> {p.pictureId}</p>
                                <p><strong>Cita:</strong> {p.photoAppointment}</p>
                                <p><strong>URL:</strong> <a href={p.photoUrl} target="_blank" rel="noreferrer" className="text-blue-600 hover:underline">Ver Foto</a></p>
                            </div>
                        ))
                    ) : (
                        <p className="text-gray-500">Sin fotografÃ­as.</p>
                    )}
                </section>
            </div>
        </AdminLayout>
    );
}
